const serviceEndpoint = 'https://localhost:5000';

export const addNumber = async (numberToAdd) => {
    const response = await fetch(
      `${serviceEndpoint}/add`,
      {
        body: {
            number: numberToAdd
        }
      }
    );
    // .then((response) => response.json());
}
